function Container() {
    return (
        <div>
            <br/>
            <center><img src="img1.jpeg" alt="Flowers" width={80} height={80} style={{borderRadius:'50%'}}/></center>
            <br/>
            <center><strong>NAME</strong></center>
            <br/>
            <center><p></p></center>
        </div>
    );
}
export default Container;
